import React from 'react';
import { useState } from 'react';
import './Register.css';
import * as Yup from 'yup';

function Register() {

    const [errors, setErrors] = useState({});
    const [formData, setformData] = useState({
        firstName: '',
        lastName: '',
        email: '',
        phone: '',
        password: '',
        confirmPassword: ''
    });

    // const [errors, setErrors] = useState({})
    // const [formData, setformData] = useState()
    // const [firstName, setFirstName] = useState('')
    // const [lastName, setLastName] = useState('')
    // const [email, setEmail] = useState('')
    // const [phone, setPhone] = useState('')
    // const [password, setPassword] = useState('')
    // const [confirmPassword, setConfirmPassword] = useState('')

    let userSchema = Yup.object({
        firstName: Yup.string().required('First name is required'),
        lastName: Yup.string().required('last name is required'),
        email: Yup.string().email('Invalid Email Format').required('Email is required'),
        phone: Yup.string().matches(/^\d{10}$/, 'Must be 10 digits').required('Phone number is required'),
        password: Yup.string()
            .required('Password is required')
            .min(8, 'Must be 8 characters')
            .matches(/[!@#$%^&*(),.?":{}|<>]/, 'Must contain one symbol')
            .matches(/[0-9]/, 'Must contain atleast one number')
            .matches(/[A-Z]/, 'Must contain atleast one uppercase')
            .matches(/[a-z]/, 'Must contain atleast one lowercase'),
        confirmPassword: Yup.string().oneOf([Yup.ref("password")], 'Password must match')
            .required('Confirm password is required'),
    });

    const handleSubmit = async (e) => {
        e.preventDefault();
        try {
            await userSchema.validate(formData, { abortEarly: false });
            console.log('Form is Submitted', formData)
        } catch (error) {
            const newErrors = {};

            error.inner.forEach((err) => {
                newErrors[err.path] = err.message;
            });
            setErrors(newErrors);
        }
    };
    const handleChange = (e) => {
        const { name, value } = e.target;

        setformData({
            ...formData,
            [name]: value,
        });
    };

    function clear() {
        setformData({
            firstName: '',
            lastName: '',
            email: '',
            phone: '',
            password: '',
            confirmPassword: ''
        });
        setErrors({});
    }
    return (
        <>
            <div className="RegisterBody" onSubmit={handleSubmit}>
                <div className="RegisterPageLogo">
                    <img src="../images/ShopinWhiteLogo.png" alt="" />
                </div>
                <div className="registerFormDiv">
                    <div className="RegisterHeadDiv">
                        <h2>Register</h2>
                        <button className='clearFormbtn' onClick={clear}>X</button>
                    </div>
                    <form className="RegisterBodyDiv" onSubmit={handleSubmit}>
                        <label htmlFor="firstName">First Name:</label>
                        <input
                            type="text"
                            name='firstName'
                            autoComplete='first name'
                            value={formData.firstName}
                            placeholder='Enter your First Name...'
                            onChange={handleChange}
                        />
                        {errors.firstName &&
                            <div
                                className="error">{errors.firstName}
                            </div>}

                        <label htmlFor="lastName">Last Name:</label>
                        <input
                            type="text"
                            name='lastName'
                            autoComplete='last name'
                            value={formData.lastName}
                            placeholder='Enter your Last Name...'
                            onChange={handleChange}
                        />
                        {errors.lastName &&
                            <div
                                className="error">{errors.lastName}
                            </div>}

                        <label htmlFor="Email">Email:</label>
                        <input
                            type='email'
                            name='email'
                            autoComplete='email'
                            value={formData.email}
                            placeholder='Enter your Email id...'
                            onChange={handleChange}
                        />
                        {errors.email &&
                            <div
                                className="error">{errors.email}
                            </div>}

                        <label htmlFor="Phone">Phone:</label>
                        <input
                            type='number'
                            name='phone'
                            value={formData.phone}
                            placeholder='Enter your Phone Number...'
                            onChange={handleChange}
                        />

                        <label htmlFor="Password">Password:</label>
                        <input
                            type='password'
                            name='password'
                            value={formData.password}
                            placeholder='Enter your Password...'
                            onChange={handleChange}
                        />

                        <label htmlFor="Confirm">Confirm:</label>
                        <input
                            type='password'
                            name='confirmPassword'
                            placeholder='Re-enter your Password...'
                            onChange={handleChange}
                        />

                        <button className="registerFormBtn" type='submit'>Submit</button>
                        <p className='navToLogin'>Already a user? then <a href="#">Login</a> Now</p>
                    </form>
                </div>
            </div>
        </>
    )
}

export default Register
